(function() {
	'use strict';

	angular.module('app.chart')
		.controller('GanttCtrl', ['$scope', '$rootScope', '$stateParams', 'DataSyncService', '$location', GanttCtrl]);

	function GanttCtrl($scope, $rootScope, $stateParams, DataSyncService, $location) {

		$scope.projectId = $stateParams.pid;
		$scope.data = [];
		$scope.options = {
			mode: 'custom',
			scale: 'day',
			sideMode: 'TreeTable',
			daily: false,
			// width: 1,
			// zoom: 1,
			columnWidth: 100,
			columns: ['model.name', 'from', 'to', 'duration', 'complete', 'daysremain', 'innerlink'],
			treeTableColumns: ['from', 'to', 'duration', 'complete', 'daysremain'],
			rowContent: '<a href="javascript:;" ng-click="scope.handleRowClick(row.model)">{{row.model.name}}</i>',
			columnsHeaders: {
				'model.name': 'Phase',
				'from': 'Start',
				'to': 'End',
				'duration': 'Duration (Days)',
				'complete': '% Complete',
				'daysremain': 'Days Remaining'
			},
			headerContents: {
				'duration':	'<i class="test">{{getHeader()}}</i>'
			},
			classes: {
				'from': 'gantt-col-rotated',
				'to': 'gantt-col-rotated',
				'duration': 'gantt-col-rotated',
				'complete': 'gantt-col-rotated',
				'daysremain': 'gantt-col-rotated'
			},
			currentDate: 'line',
			currentDateValue: new Date(),
			columnsFormatters: {
				'from': function(from) {
					return from !== undefined ? from.format('M/DD/YY') : undefined;
				},
				'to': function(to) {
					return to !== undefined ? to.format('M/DD/YY') : undefined;
				}
			},
		};
		$scope.scrollEvent = function(event) {
			if (angular.equals(event.direction, "left")) {
				// Raised if the user scrolled to the left side of the Gantt. Use this event to load more data.
				console.log('Scroll event: Left');
			} else if (angular.equals(event.direction, "right")) {
				// Raised if the user scrolled to the right side of the Gantt. Use this event to load more data.
				console.log('Scroll event: Right');
			}
		};
		$scope.handleRowClick = function(model) {
			$location.path(model.columnContents.innerlink);
		};
		DataSyncService.loadProject($scope.projectId, function(response) {
			if (response.success) {
				$scope.projectDetail = $rootScope.currentProject;
				$scope.phaseData = $rootScope.phaseData;
				var phaseArray = ['Define', 'Measure', 'Analyze', 'Improve', 'Control'];
				var tempObj = {},
					tempObj2 = {};

				if ($scope.projectDetail.ControlReviewDate){
					var projFrom = moment($scope.projectDetail.DateTimeCreated,'YYYYMMDD');
					var projTo = moment($scope.projectDetail.ControlReviewDate,'YYYYMMDD');

					tempObj = {
						'name':'Project Timeline',
						'columnContents': {
							'duration': projTo.diff(projFrom,'days'),
							'complete': Math.round($scope.projectDetail.CompletionPercentage) + '%',
							'daysremain': projTo.diff(new Date(), 'days'),
							'innerlink': ''
						},
						'tasks': [{
							'name': '',
							'from': projFrom,
							'to': projTo,
							'color': '#bcbcbc'
						}]
					};
					$scope.data.push(tempObj);
				}

				for (var i = 0; i < phaseArray.length; i++) {
					var tempArr = [],
						totalDuration = 0,
						completion = 0,
						completed = 0;
					var p = DataSyncService.getPhaseDetail(phaseArray[i]);
					console.log('phaseDetails', p);
					tempObj = {
						'name': phaseArray[i] + ' Phase',
						'children': []
					};
					var z = 0;
					var passedDiagram = false;
					for (var k in p) {
						z++;
						// if(phaseArray[i] === 'Define'){
						// 	if('Value Stream Diagram' === p[k].Name || 'SIPOC' === p[k].Name){
						// 		passedDiagram = true;
						// 	}
						// 	if(passedDiagram){
						// 		if(
						// 			($scope.currentProject.DiagramType === 'SIPOC' && p[k].Name === 'Communication') || // after SIPOC
						// 			($scope.currentProject.DiagramType === 'Value Stream Diagram' && p[k].Name === 'Value Stream Diagram') // after Value Stream Diagram
						// 		){
						// 			z++; // Skip One Tab
						// 		}
						// 	}
						// }
						if (p[k].DateTimeStarted) {
							tempObj.children.push(p[k].Id);
							var f = moment(p[k].DateTimeStarted,'YYYYMMDD');
							var t = moment(p[k].LastUpdated,'YYYYMMDD');
							var duration = t.diff(f,'days');
							tempObj2 = {
								'id': p[k].Id,
								'name': p[k].Name,
								'tasks': [{
									'name': '        ',
									'from': f,
									'to': t,
									'color': '#bcbcbc',
									'movable': false
								}],
								'columnContents': {
									'duration': duration,
									'complete': ((p[k].Status !== 'working') ? '<i class="fa fa-check"></i>' : ''),
									'daysremain': '',
									'innerlink': phaseArray[i].toLowerCase() + '/' + $scope.projectId + '/' + z
								}
							};
							if (p[k].Status !== 'working') {
								completed++;
							}
							tempArr.push(tempObj2);
							totalDuration += duration;
						}
					}
					var daysremain = moment($scope.projectDetail[phaseArray[i]+'ReviewDate']).diff(moment(),'days');
					completion = (completed / Object.keys(p).length) * 100;
					tempObj.columnContents = {
						'duration': totalDuration,
						'complete': Math.round(completion) + '%',
						'daysremain': daysremain,
						'innerlink': phaseArray[i].toLowerCase() + '/' + $scope.projectId + '/1'
					};
					$scope.data.push(tempObj);
					$scope.data.push.apply($scope.data, tempArr);
				}
				console.log('GANTT DATA', $scope.data);
			} else {
				$location.path('/dashboard');
			}
		});
	}
})();

