				$scope.submitCEMatrix = function() {
					phaseComponentDetail = DataSyncService.getPhaseComponentDetail('Analyze', 'C&E Matrix');
					var toUpdate = [],
						toDelete = [],
						toAdd = [],
						dToUpdate = [],
						dToAdd = [];
					for (var i = 0; i < $scope.ceMatrixOutputData.length; i++) {
						var sd = angular.copy($scope.ceMatrixOutputData[i]);
						if (sd.Id && sd.isDeleted) {
							toDelete.push(sd.Id);
							$scope.ceMatrixOutputData[i].Id = false;
						} else if (sd.Id) {
							delete sd.DateTimeCreated;
							delete sd.LastUpdated;
							toUpdate.push(sd);
						}
					}
					DataSyncService.syncTableRowData('analyzecematrixoutputs', toAdd, toUpdate, toDelete, false);
					$scope.ceMatrixOutputDataOrig = angular.copy($scope.ceMatrixOutputData);

					toUpdate = [];
					toDelete = [];
					toAdd = [];
					for (var i = 0; i < $scope.ceMatrixRowData.length; i++) {
						var sd = angular.copy($scope.ceMatrixRowData[i]);
						if (sd.Id && sd.isDeleted) {
							toDelete.push(sd.Id);
							$scope.ceMatrixRowData[i].Id = false;
						} else if (sd.Id) {
							for (var z = 0; sd.colData && z < sd.colData.length; z++) {
								var dSd = angular.copy(sd.colData[z]);
								if (dSd.Id && !dSd.isDeleted) {
									delete dSd.DateTimeCreated;
									delete dSd.LastUpdated;
									dToUpdate.push(dSd);
								} else if (!dSd.isDeleted) {
									dToAdd.push(dSd);
								}
							}
							delete sd.DateTimeCreated;
							delete sd.LastUpdated;
							delete sd.colData;
							delete sd.rowTotal;
							toUpdate.push(sd);
						}
					}

					DataSyncService.syncTableRowData('analyzecematrix', toAdd, toUpdate, toDelete, false);
					DataSyncService.syncTableRowData('analyzecematrixdata', dToAdd, dToUpdate, []);
					$scope.ceMatrixRowDataOrig = angular.copy($scope.ceMatrixRowData);
					$timeout(function() {
						$scope.loadCEMatrixData();
					}, 1200);

				};
