				$scope.submitGateReview = function() {
					phaseComponentDetail = DataSyncService.getPhaseComponentDetail('Analyze', 'Gate Review');
					var toUpdate = [],
						toDelete = [],
						toAdd = [];
					for (var i = 0; i < $scope.gateReviewData.length; i++) {
						if (!angular.equals($scope.gateReviewData[i], $scope.gateReviewDataOrig[i])) {
							var sd = angular.copy($scope.gateReviewData[i]);
							if (sd.Id && sd.isDeleted) {
								toDelete.push(sd.Id);
								$scope.gateReviewData[i].Id = false;
							} else if (sd.Id) {
								delete sd.DateTimeCreated;
								delete sd.LastUpdated;
								delete sd.arrayId;
								toUpdate.push(sd);
							} else if (!sd.Id && !sd.isDeleted) {
								sd.ProjectId = $scope.projectId;
								sd.PhaseId = phaseComponentDetail.PhaseId;
								sd.PhaseComponentId = phaseComponentDetail.Id;
								delete sd.arrayId;
								toAdd.push(sd);
							}
						}
					}
					DataSyncService.syncTableRowData('gatereview', toAdd, toUpdate, toDelete);
					$scope.gateReviewDataOrig = angular.copy($scope.gateReviewData);
				};
